
'use strict';

var vks = angular.module('VandelKartingStandings', ['ngMaterial', 'ngMessages', 'material.svgAssetsCache']);

vks.config(['$httpProvider', function ($httpProvider) {
    $httpProvider.defaults.useXDomain = true;
    delete $httpProvider.defaults.headers.common['X-Requested-With'];
}
]);

vks.controller('standingsCtrl', function ($scope, $http, filterFilter, $filter) {

    var stdCtrl = this;

    //Race Modal
    stdCtrl.showRaceModal = false;
    stdCtrl.ShowRace = function(race) {
        stdCtrl.selectedRace = race;
        stdCtrl.getRaceResultsForRace(race.Id);
        stdCtrl.showRaceModal = true;
    };
    stdCtrl.CloseRace = function(race) {
        stdCtrl.showRaceModal = false;
        stdCtrl.classSearchText = "";
    };

    //Create Race Modal
    stdCtrl.showCreateRaceModal = false;
    stdCtrl.ShowCreateRace = function () {
        stdCtrl.showCreateRaceModal = true;
    };
    stdCtrl.CloseCreateRace = function () {
        stdCtrl.showCreateRaceModal = false;
    };

    //Create Race Modal
    stdCtrl.showCreateSeasonModal = false;
    stdCtrl.ShowCreateSeason = function () {
        stdCtrl.showCreateSeasonModal = true;
    };
    stdCtrl.CloseCreateSeason = function () {
        stdCtrl.showCreateSeasonModal = false;
    };

    stdCtrl.showCreateTeamModal = false;
    stdCtrl.ShowCreateTeam = function () {
        stdCtrl.showCreateTeamModal = true;
    };
    stdCtrl.CloseCreateTeam = function () {
        stdCtrl.showCreateTeamModal = false;
    };



    stdCtrl.DeleteRace = function(race) {
        if (confirm("Er du sikker på at du vil slette, " + race.Name) == true) {
            $http.delete("http://localhost:9000/api/races/" + race.Id)

                .then(function successCallback(response) {
                    var index = stdCtrl.selectedSeason.Races.indexOf(race);
                    stdCtrl.selectedSeason.Races.splice(index, 1);
                }, function errorCallback(response) {
                    console.log("Unable to delete race");
                });
        } else {
        }
    };

    stdCtrl.NewRace = function (raceName) {
        if (typeof (stdCtrl.selectedSeason) !== "undefined" && Object.keys(stdCtrl.selectedSeason).length !== 0) {
            var race = {
                Id: undefined,
                Name: raceName,
                SeasonId: stdCtrl.selectedSeason.Id
            };
            $http.post("http://localhost:9000/api/races/", race)
                .then(function successCallback(response) {

                        race.Id = response.data;
                        stdCtrl.selectedSeason.Races.push(race);
                    },
                    function errorCallback(response) {
                        console.log("Unable to create new race");
                    });
        }
    };

    stdCtrl.SelectClass = function (classType) {
        stdCtrl.selectedClass = classType;
        stdCtrl.getSelectedRaceResults(classType);
    };

    stdCtrl.getSelectedRaceResults = function (classType) {
        stdCtrl.ResultDriverSearchText = [];
        stdCtrl.selectedRaceResults = [];
        if (typeof classType !== "undefined") {
            angular.forEach(stdCtrl.selectedRace.RaceResults, function (result, key) {
                if (result.ClassTypeId == classType.Id) {
                    result.Driver = stdCtrl.getDriverById(result.DriverId);
                    stdCtrl.selectedRaceResults.push(result);
                }
            });
        }
    };

    stdCtrl.ClassSearch = function (query) {
        var results = query ? filterFilter(stdCtrl.selectedSeason.PointSystem.ClassTypes, { Name: query }, stdCtrl.startsWith) : stdCtrl.selectedSeason.PointSystem.ClassTypes;
        return results;
    };


    stdCtrl.SelectDriver = function (driver, result) {
        if (typeof (driver) !== "undefined" && Object.keys(driver).length !== 0) {
            result.Driver = driver;
            result.DriverId = driver.Id;
        } else {
            result.DriverId = undefined;
        }
        
        //update raceResult
        $http.put("http://localhost:9000/api/results/" + result.Id, result)

            .then(function successCallback(response) {
                stdCtrl.getRaceResultsForRace(result.RaceId);
                stdCtrl.getResultsForSeason(stdCtrl.selectedSeason.Id);
            }, function errorCallback(response) {
                console.log("Unable to update result");
            });
    };

    stdCtrl.DriverSearch = function (query) {
        var results = query ? filterFilter(stdCtrl.AllDrivers, { Name: query }, stdCtrl.startsWith) : stdCtrl.AllDrivers;
        return results;
    }

    stdCtrl.SelectCup = function (cup) {

        if (typeof (cup) !== "undefined" && Object.keys(cup).length !== 0) {
            stdCtrl.selectedCup = cup;


        }
        stdCtrl.SelectSeason(undefined);
        //Fetch Pointsystem for the cup
    };

    stdCtrl.CupSearch = function (query) {
        var results = query ? filterFilter(stdCtrl.Cups, { Name: query }, stdCtrl.startsWith) : stdCtrl.Cups;
        return results;
    }

    stdCtrl.newCup = function (cup) {
        var myCup = {
            Id: undefined,
            Name: cup,
            Description: cup
        };
        $http.post("http://localhost:9000/api/cups/", myCup)

            .then(function successCallback(response) {
                
                myCup.Id = response.data;
                stdCtrl.Cups.push(myCup);
                stdCtrl.SelectCup(myCup);
            }, function errorCallback(response) {
                console.log("Unable to create cup");
            });
    };

    stdCtrl.SelectSeason = function (season) {
        if (typeof (season) !== "undefined" && Object.keys(season).length !== 0) {
            stdCtrl.selectedSeason = season;
            stdCtrl.pointSystem = stdCtrl.getPointSystem(season.Id);
            stdCtrl.standings = stdCtrl.getResultsForSeason(season.Id);
            stdCtrl.Teams = stdCtrl.getTeamsForSeason(season.Id);

        } else {

            stdCtrl.selectedSeason = season;
            stdCtrl.standings = [];
            stdCtrl.pointSystem = {};
            stdCtrl.Drivers = [];
            stdCtrl.Teams = [];
        }

        //Fetch driver informations and results for the season
    };

    stdCtrl.SeasonSearch = function (query) {
        if (stdCtrl.selectedCup !== null && typeof (stdCtrl.selectedCup) !== "undefined" && Object.keys(stdCtrl.selectedCup).length !== 0) {
            if (typeof (stdCtrl.selectedCup.Seasons) !== "undefined" && Object.keys(stdCtrl.selectedCup.Seasons).length !== 0) {
                var results = query ? filterFilter(stdCtrl.selectedCup.Seasons, { Name: query }, stdCtrl.startsWith) : stdCtrl.selectedCup.Seasons;
                return results;
            } 
        }
        
        return [];
    }

    stdCtrl.startsWith = function (actual, expected) {
        var lowerStr = (actual + "").toLowerCase();
        return lowerStr.indexOf(expected.toLowerCase()) === 0;
    };

    stdCtrl.getDriverById = function (id) {
        return stdCtrl.Drivers[id];
        for (var i = 0; i < stdCtrl.Drivers.length; i++) {
            if (stdCtrl.Drivers[i].Id === id) {
                return stdCtrl.Drivers[i];
            }
        }
        return null;
    };

    stdCtrl.newDriver = function (driver, result) {
        var myDriver = {
            Id: undefined,
            Name: driver,
            DisplayName: driver
        };
        $http.post("http://localhost:9000/api/drivers/", myDriver)

            .then(function successCallback(response) {

                myDriver.Id = response.data;
                stdCtrl.Drivers.push(myDriver);
                stdCtrl.AllDrivers.push(myDriver);
                stdCtrl.SelectDriver(myDriver, result);
            }, function errorCallback(response) {
                console.log("Unable to create new driver");
            });

    };

    stdCtrl.calcPoints = function () {
        
        angular.forEach(stdCtrl.Drivers, function (driver, key) {
            driver.points = [];
            angular.forEach(stdCtrl.selectedSeason.Races, function (race, key) {
                angular.forEach(driver.RaceResults, function (res, key) {
                    if (res.RaceId == race.Id) {
                        stdCtrl.addPointsForClassAndPosition(res.ClassTypeId, res.Position, driver, race.Id);
                    }
                });
            });
            driver.totalPoints = driver.points.reduce(stdCtrl.add, 0);
        });

        angular.forEach(stdCtrl.Teams, function (team, key) {
            team.points = [];
            angular.forEach(stdCtrl.selectedSeason.Races, function (race, key) {
                angular.forEach(team.TeamDrivers, function (td, key) {
                    if (typeof (stdCtrl.getDriverById(td.DriverId)) != "undefined" && typeof (stdCtrl.getDriverById(td.DriverId).points[race.Id]) != "undefined") {
                        if (typeof (team.points[race.Id]) == "undefined")
                            team.points[race.Id] = 0;
                        team.points[race.Id] += stdCtrl.getDriverById(td.DriverId).points[race.Id];
                    }

                });
            });
            team.totalPoints = team.points.reduce(stdCtrl.add, 0);
        });
    };

    stdCtrl.addPointsForClassAndPosition = function (classId, position, driver, raceId) {
        angular.forEach(stdCtrl.PointSystem.ClassTypes, function (classtype, key) {
            if (classtype.Id == classId) {
                angular.forEach(classtype.ClassPointSystems, function (pointstm, key) {
                    if (pointstm.Position === position) {
                        driver.points[raceId] = pointstm.Points;
                    }
                });
            }
        });
    };

    stdCtrl.NewSeason = function (name, cupId, pointsystemId)
    {
        var newSeason = {
            Id: undefined,
            Name: name,
            CupId: cupId,
            PointSystemId: pointsystemId
        };

        
        $http.post("http://localhost:9000/api/seasons/", newSeason)

            .then(function successCallback(response) {

                newSeason.Id = response.data;
                stdCtrl.selectedCup.Seasons.push(newSeason);
                stdCtrl.SelectSeason(newSeason);
                stdCtrl.CloseCreateSeason();
            }, function errorCallback(response) {
                console.log("Unable to create new season");
            });
    }


    stdCtrl.NewTeam = function (name, driver1Id, driver2Id) {
        var newTeam = {
            Id: undefined,
            Name: name,
            SeasonId: stdCtrl.selectedSeason.Id
        };
        $http.post("http://localhost:9000/api/team/", newTeam)

            .then(function successCallback(response) {

                newTeam.Id = response.data;
                stdCtrl.NewTeamDriver(newTeam.Id, driver1Id);
                stdCtrl.NewTeamDriver(newTeam.Id, driver2Id);
                stdCtrl.getTeamsForSeason(stdCtrl.selectedSeason.Id);
                stdCtrl.CloseCreateTeam();
            }, function errorCallback(response) {
                console.log("Unable to create new Team");
                console.log(response);
            });

    }

    stdCtrl.NewTeamDriver = function(teamId, driverId) {
        var newTeamDriver = {
            Id: undefined,
            TeamId: teamId,
            DriverId: driverId
        };

        $http.post("http://localhost:9000/api/TeamDriver/", newTeamDriver)
            .then(function successCallback(response) {
                newTeamDriver.Id = response.data;
                stdCtrl.getTeamsForSeason(stdCtrl.selectedSeason.Id);
            }, function errorCallback(response) {
                console.log("Unable to create new Team Driver");
                console.log(response);
            });
    }

    stdCtrl.getTeamsForSeason = function(seasonId) {
        $http.get("http://localhost:9000/api/seasons/" + seasonId + "/teams/")
            .then(function successCallback(response) {
                
                stdCtrl.Teams = response.data;
                stdCtrl.calcPoints();
            }, function errorCallback(response) {
                console.log("Unable to get Teams");
                console.log(response);
            });
    }

    stdCtrl.add = function (a, b) {
        return a + b;
    };


    stdCtrl.getRaceResultsForRace = function (raceId) {
        $http.get("http://localhost:9000/api/results/" + raceId)
            .then(function successCallback(response) {

                stdCtrl.selectedRace.RaceResults = response.data;
            }, function errorCallback(response) {
                console.log("Unable to get Race results");
                console.log(response);
            });
    }

    stdCtrl.getDrivers = function () {
        $http.get("http://localhost:9000/api/drivers/")
            .then(function successCallback(response) {
                
                stdCtrl.AllDrivers = response.data;
            }, function errorCallback(response) {
                console.log("Unable to get drivers");
            });
    }

    stdCtrl.getResultsForSeason = function (seasonId) {
        $http.get("http://localhost:9000/api/seasons/" + seasonId + "/drivers/")
            .then(function successCallback(response) {
                
                //stdCtrl.Drivers = response.data;
                stdCtrl.Drivers = [];
                response.data.forEach(function (driver) {
                    if (driver != null) {
                        stdCtrl.Drivers[driver.Id] = driver;
                    }
                    
                });
                stdCtrl.calcPoints();
            }, function errorCallback(response) {
                console.log("Unable to perform get request");
            });
    }
    

    stdCtrl.getPointSystem = function (seasonId) {
        $http.get("http://localhost:9000/api/pointSystems/" + seasonId)
            .then(function successCallback(response) {
                stdCtrl.PointSystem = response.data[0];
            }, function errorCallback(response) {
                console.log("Unable to get pointsystems");
            });
    }

    stdCtrl.getCups = function () {
        $http.get("http://localhost:9000/api/cups")
            .then(function successCallback(response) {

                stdCtrl.Cups = response.data;
            }, function errorCallback(response) {
                console.log("Unable to get cups");
            });
    }

    stdCtrl.getPointSystems = function () {
        $http.get("http://localhost:9000/api/pointSystems/")
            .then(function successCallback(response) {
                //console.log(response.data);
                stdCtrl.AllPointsystems = response.data;
            }, function errorCallback(response) {
                console.log("Unable to get cups");
            });
    }

    //<Create PDFs>
    stdCtrl.buildTableBody = function (drivers, columns) {
        var body = [];

        body.push(columns);
        var pos = 1;
        
        drivers.sort(function (a, b) { return b.totalPoints - a.totalPoints });
        drivers.forEach(function (driver) {
            if (pos <= 50) {
                var dataRow = [];
                dataRow.push(pos);
                dataRow.push(driver.Name);


                stdCtrl.selectedSeason.Races.forEach(function (race) {
                    if (driver.points[race.Id]) {
                        dataRow.push(driver.points[race.Id]);
                    } else {
                        dataRow.push('');
                    }
                });

                dataRow.push(driver.totalPoints);

                body.push(dataRow);
                pos++;
            }
        });
        return body;
    }

    stdCtrl.getColumnwidths = function () {
        var res = [];
        var posWidth = 20;
        var nameWidth = 100;
        var restwidth = "*";
        var totalWidth = "*";
        res.push(posWidth);
        res.push(nameWidth);
        
        stdCtrl.selectedSeason.Races.forEach(function (col) {
            res.push(restwidth);
        });
        res.push(totalWidth);
        return res;
    }

    stdCtrl.table = function (data, columns) {
        return {
            table: {
                widths: stdCtrl.getColumnwidths(),
                headerRows: 1,
                body: stdCtrl.buildTableBody(data, columns)
            }
        };
    }


    stdCtrl.createPDF = function () {
        var columns = [];
        columns.push("Pos.");
        columns.push("Driver");
        stdCtrl.selectedSeason.Races.forEach(function(race) {
            columns.push(race.Name);
        });
        columns.push("Total");
        var dd = {
            background: {

                image: 'data:image/png;base64,',
                width: 600,
                height: 900
            },
            content: [
                {
                    table: {
                        widths: [370, "*"],
                        headerRows: 1,
                        border: 0,
                        body: [
                            [
                                { text: stdCtrl.selectedCup.Name + " " + stdCtrl.selectedSeason.Name, style: 'header' },
                                {
                                    image: 'data:image/png;base64,',
                                    width: 120
                                }
                            ]
                        ]
                    },
                    layout: 'noBorders'
                },


                stdCtrl.table(stdCtrl.Drivers, columns)
            ],
            styles: {
                header: {
                    fontSize: 18,
                    bold: true
                },
                subheader: {
                    fontSize: 15,
                    bold: true
                },
                quote: {
                    italics: true
                },
                small: {
                    fontSize: 8
                }
                
            },
            defaultStyle: {
                fontSize: 7.5,
                bold: true
            }
        }
        var fileName = "";
        fileName = stdCtrl.selectedCup.Name + " "+ stdCtrl.selectedSeason.Name + " Results";
        pdfMake.createPdf(dd).download(fileName);
    };

    //</Create PDFs>
    
    stdCtrl.init = function () {
        
        stdCtrl.Cups = {};
        stdCtrl.Drivers = [];
        stdCtrl.getDrivers();
        stdCtrl.getCups();
        stdCtrl.getPointSystems();
    };

});
